import React from 'react';
import ReactDOM, { render } from 'react-dom';
import './index.css';

import mainLogo from './Tetris_T.png';

  class Item extends React.Component{
    constructor(props){
      super(props);
      const FREE = 0;
      const DRAG = 1;

      this.state = FREE;
    }

    render(){
      return(
        <div>
          <img src={mainLogo} 
            alt="Tetris T Piece" 
            width="140" height="100"
            position="absolute"
            top="10" left="50"
            onClick={() => alert(this.state)}
          />

        </div>
      )
    }
  }

  class App extends React.Component{
      render() {
        return(
          <div>
            <Item />
          </div>
        )
      }
  }

  ReactDOM.render(
    <App />,
    document.getElementById('root')
  );
